import styled from "styled-components";
import {ITodoList} from "../shared/types";

const List = styled.ul`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  list-style: none;
  padding: 0;
  margin: 0 auto;
  width: 100%;
`;


export default function TodoList({children}:ITodoList) {
    return (
        <List>
            {children}
        </List>
    )
}
